import React from 'react';
import {Page, Pagebg, Title, PostArticleBtn, ArticleList, ArticleText, ArticleContainer, ArticleAuthor, ArticleBody}  from './components/ArticleStyle.js';
import { Routes ,Route,Link } from 'react-router-dom';
import {useState} from "react";


const TimeTable=()=> {
    function TimeTable() {

        const timetableData = [
            { time: '08:00', Monday: 'Math', Tuesday: 'English', Wednesday: '', Thursday: '', Friday: '' },
            { time: '09:00', Monday: 'Science', Tuesday: 'Math', Wednesday: 'English', Thursday: '', Friday: '' },
            // 其他课程数据
          ];
      
        return (
        <div className="timetable">
        <table>
          <thead>
            <tr>
              <th>时间</th>
              <th>星期一</th>
              <th>星期二</th>
              <th>星期三</th>
              <th>星期四</th>
              <th>星期五</th>
            </tr>
          </thead>
          <tbody>
          {timetableData.map((row, index) => (
            <tr key={index}>
              <td>{row.time}</td>
              <td>{row.Monday}</td>
              <td>{row.Tuesday}</td>
              <td>{row.Wednesday}</td>
              <td>{row.Thursday}</td>
              <td>{row.Friday}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
        );
    }

    return (

                <Routes>
                    <Route path="/" element={<TimeTable />} />
                </Routes>
             
    );
}

export default TimeTable;
